import {useEffect, useState} from "react";
import axios from "axios";

function App() {
    const [hello, setHello] = useState('');

    useEffect(() => {
        console.log('냠')
        axios.get('/test')
            .then((res) => {
                setHello(res.data);
                console.log('냠', res.data)
            })
    }, []);
    const request = new XMLHttpRequest();
    return (
        <div className="App">
            백엔드 데이터 : {hello}
        </div>
    );
}

export default App;
